import React from "react";
import { Link } from "react-router-dom";
import "./user_list.css"

const User = () => {
    const users = useLocation((state) => state.users);

    return (
        users.map((user, i) =>
            <Link to="/">
                <div> {user.username}</div>
            </Link>
        )
    )
};

export default User;
